import React,{useState} from 'react'
import { Container,Row,Form,Col, Button } from 'react-bootstrap'
import Input from '../layout/Input'
import {login} from '../actions/authactions'
import {useDispatch} from 'react-redux'
const SignIn = (props) => {
  const dispatch = useDispatch()
const [input, setInput] = useState({
    email:'',
    password:''
  });
  const hanleChange = (e) => {
    const { name, value } = e.target;
    setInput({
      ...input,
      [name]: value,
    });
    console.log("input", input);
  };

  const userLogin = () => {
    dispatch(
        login(input.email, input.password)
    );
    console.log("inpuuuuuuuuuuuut", input);
  };
    return (
        <div>
             <Container>
                <Row>

                        <Form onSubmit={userLogin}>
                            <Row>
                            <Input label="Email" placeholder="Email" name='email'  type="email" onChange={(e)=>hanleChange(e)} />
                            <Input label="Password" placeholder="Password" name='password'  type="password" onChange={(e)=>hanleChange(e)} />
                             <Button variant="primary" type="submit" className="mt-5    ">sign in</Button>
                            </Row>
                        </Form>

                </Row>
            </Container>
        </div>
    )
}

export default SignIn
